import logo from './logo.svg';
import './App.css';

function App() {
  return (

      <body>
      <section class="section">
        <div class="container">
          <div class="columns">
            <div class="column"></div>
            <div class="column"></div>
          </div>
        </div>
      </section>
      </body>
  );
}

export default App;
